up);\n                \n                 GetCaseTicketInfos ticketInfos = new CRMFixedOper.GetCaseTicketInfos { Tickets = new List<TicketInfo>() };\n                  \n                  if(ticketEntities != null)\n\t\t  {\n\t\t\tforeach(var ticketEntity in ticketEntities )\n\t\t       {\n                                var id = (long) ticketEntity.FieldValues[\"ID\"];\n\t\t\t\tif(id == ticketId) \n\t\t\t\t   continue;\n\n\t\t\t\tvar  completedTime  = ticketEntity.FieldValues[\"CompletedTime\"];\n\t\t\t\tvar completedBy = ticketEntity.FieldValues[\"CompletedBy\"];\n\t\t\t\tvar freeNotes= ticketEntity.FieldValues[\"FreeNotes\"];\n\n\t\t\t\tvar ticketInfo = new TicketInfo();\n\t\t\t\t ticketInfo.ID = id;\n\t\t\t\t ticketInfo.Title= ticketEntity.FieldValues[\"Title\"].CastWithValidate<string>(\"Title\") ;\n\t\t\t\t ticketInfo.TicketType=  (int)  ticketEntity.FieldValues[\"TicketType\"];\n\t\t\t\t ticketInfo.CreatedTime =(DateTime) ticketEntity.FieldValues[\"CreatedTime\"];\n                                 ticketInfo.CompletedTime= completedTime; // != null ? (DateTime) completedTime : null;\n\t\t\t\t ticketInfo.Notes =  freeNotes != null ? (string) freeNotes : null;\n\t\t\t\t ticketInfo.CompletedBy = completedBy; // != null ? (int) completedBy : null;\n\t\t\t\t\n\t\t\t\t ticketInfos.Tickets.Add(ticketInfo);\n                        }\n                   }       \n\n                 return ticketInfos.Tickets != null && ticketInfos.Tickets.Count > 0 ? ticketInfos : null;\n   }\n\n}\n\n#endregion"}}',-1,'2019-06-24 16:21:43.040',-1,'2019-07-05 18:05:34.660'),
